import { Component, OnInit, Output, EventEmitter, Input } from '@angular/core';
import { UsersService } from '../users.service'
import {KeyValue} from '@angular/common';

@Component({
  selector: 'app-map-search',
  templateUrl: './map-search.component.html',
  styleUrls: ['./map-search.component.css']
})
export class MapSearchComponent  {
title = 'Where in the world?'
onCompare(_left: KeyValue<any, any>, _right: KeyValue<any, any>): number {
  return -1;
}

populations: any = []
region: any = []
capital: any = []
flags: any = []
countries: any= []
countryName = ''
id = ''
dataSet = ''
objectKeys = Object.keys;
nestedArray: any = { }


constructor(private user: UsersService){}



ngOnInit() {
  this.user.getAllData().subscribe(allData => {
    let myloop = Object.entries(allData);

    for(let i = 0; i < myloop.length; i++){  
    let countryName: any = Object.entries(allData)[i][1].name.common
    this.countries.push(countryName)
    this.nestedArray[countryName] = []

    }

  console.log(Object.keys(this.nestedArray))
  for (let x in Object.keys(this.nestedArray)){
  this.user.getMoreData(x).subscribe(data => {

    let dataSet: any = Object.entries(data)[0][1]

    this.nestedArray[x] = dataSet.population
    this.nestedArray[x] = dataSet.region
    this.nestedArray[x] = dataSet.capital
    this.nestedArray[x] = this.flags.push(dataSet.flags.png)
  }


  )} 

})}









}
